import { Link } from "react-router-dom";

const Alphabetize = ({ datas }) => {
  let beerArr = [];
  datas.map((data) => {
    beerArr.push(data.name);
  })
  beerArr.sort();

  return (
    beerArr.map((beer) => {
      return (  
        <option key={beer} value={beer}>{beer}</option>  
      )
    })
  )
};

export default Alphabetize
